import { Routes, Route } from "react-router-dom";
import UserRegister from "./UserRegister";
import UserLogin from "./UserLogin";
import UserDashboard from "./UserDashboard";
import AllNews from "./AllNews";  // FIX: Ensure this file exists
import PersonalizedNews from "./PersonalizedNews";

export default function Usermain() {
  return (
    <Routes>
      <Route path="/user/user-register" element={<UserRegister />} />
      <Route path="/" element={<UserLogin />} />
      <Route path="/user/user-dashboard" element={<UserDashboard />} />
      <Route path="/all-news" element={<AllNews />} />  
      <Route path="/personalized-news" element={<PersonalizedNews />} />
    </Routes>
  );
}
